              <a href="https://leetcode.com/user6355mQ/" target="_blank"> <SiLeetcode /> </a>
            </div>
          </div>
        </div>
      </div>
      <CollegeDegrees />
      <BtechDegree />
      <Certification />
    </div>
  );
};

export default EducationContent;
